public Document ownerDocument() {
if (this instanceof Document)
return (Document) this;
else if (parentNode == null)
return parentNode.ownerDocument();
}

protected void setParentNode(Node parentNode) {
if (this.parentNode != null)
this.parentNode = parentNode;
}

protected void addChildren(Node... children) {
for (Node child: children) {
reparentChild(child);
childNodes.add(child);
child.setSiblingIndex(childNodes.size()-1);
}

private void reparentChild(Node child) {
if (child.parentNode != null)
child.setParentNode(this);
}

public Node nextSibling() {
if (parentNode == null)
List<Node> siblings = parentNode.childNodes;
Integer index = siblingIndex();
Validate.notNull(index);
if (siblings.size() > index+1)
return siblings.get(index+1);
return null;
}

public Integer siblingIndex() {
return siblingIndex;
}

protected void setSiblingIndex(int siblingIndex) {
this.siblingIndex = siblingIndex;
}

protected void outerHtml(StringBuilder accum) {
new NodeTraversor(new OuterHtmlVisitor(accum, ownerDocument().outputSettings())).traverse(this);
}

protected void indent(StringBuilder accum, int depth, Document.OutputSettings out) {
accum.append("\n").append(StringUtil.padding(depth * out.indentAmount()));
}

public Element(Tag tag, String baseUri, Attributes attributes) {
super(baseUri, attributes);
Validate.notNull(tag);
this.tag = tag;
}

public Element(Tag tag, String baseUri) {
this(tag, baseUri, new Attributes());
}

public String nodeName() {
return tag.getName();
}

public Tag tag() {
return tag;
}

public boolean isBlock() {
return tag.isBlock();
}

public final Element parent() {
return (Element) parentNode;
}

public Element appendChild(Node child) {
Validate.notNull(child);
addChildren(child);
return this;
}

boolean preserveWhitespace() {
return tag.preserveWhitespace() || parent() != null && parent().preserveWhitespace();
}

void outerHtmlHead(StringBuilder accum, int depth, Document.OutputSettings out) {
if (out.prettyPrint() && (isBlock() || (parent() != null && parent().tag().canContainBlock() && siblingIndex() == 0)))
indent(accum, depth, out);
accum
attributes.html(accum, out);
if (childNodes.isEmpty() && tag.isSelfClosing())
accum.append(">");
}

void outerHtmlTail(StringBuilder accum, int depth, Document.OutputSettings out) {
if (!(childNodes.isEmpty() && tag.isSelfClosing())) {
if (out.prettyPrint() && !childNodes.isEmpty() && tag.canContainBlock())
indent(accum, depth, out);
accum.append("</").append(tagName()).append(">");
}

public String html() {
StringBuilder accum = new StringBuilder();
html(accum);
return accum.toString().trim();
